After 10 days break from climbing, I went to Panský les on the way to Prague, and I was pleasantly surprised by the crag, beauty of the forest and my climbing 👌This boulder problem is Guru 8A+ (Czech Republic). Check out the stories too. I got a funny "ass drop" version there 😃 And some more climbing movies. 

